import {

    IonButton,
    IonInput,
    IonItem,
    IonLabel,
    IonCardContent,
    IonCard,
    IonCardHeader,
    IonCardTitle,
    IonToolbar,
    IonTitle,


} from "@ionic/react";
import React, { useEffect, useState } from 'react';
import { Editor } from '@tinymce/tinymce-react';
import baseUrl, { api } from '../../pages/Urls';
import { Collapse } from 'react-bootstrap';
import swal from 'sweetalert';
import { useForm, Controller } from "react-hook-form";
import { ErrorMessage } from "@hookform/error-message";
const AddTopicArticle: React.FC<{
    onClose: () => void;
    fetchViewTopic: () => void;
    open: boolean;
    topic_name: string
}> = (props) => {
    const [topic_name, setTopic_name] = useState('')
    useEffect(() => {
        setTopic_name(props.topic_name);
    }, [props.topic_name]);
    const {
        handleSubmit,
        register,
        formState: { errors },
        reset,
        control,
        setValue,
    } = useForm({
        defaultValues: {
            topic_name: topic_name,
            name: '',
            content: '',

        }
    });

    console.log(props.topic_name)
    const addTopicArticle = (e: any) => {
        {

            fetch(`${baseUrl}${api.addTopicArticle}`, {
                method: 'POST',
                headers: {
                    Accept: 'application/json',
                    'Content-Type': 'application/json',
                    'Authorization': `Bearer ${localStorage.getItem("token")}`
                },
                body: JSON.stringify(e),

            })

                .then(response => {
                    if (response.status === 200) {
                        props.fetchViewTopic();
                        props.onClose();
                        reset({
                            name: '',
                            content: '',
                            topic_name: topic_name,

                        })
                        swal({
                            title: "Success!",
                            text: "Topic Article Created successfully",
                            icon: "success",
                        });

                    }
                    else {
                        throw Error([response.status, response.statusText].join(' '));
                    }
                })

                .catch(error => console.log('error', error));

        }

    }
    return (
        <Collapse in={props.open}>
            <div className="container mt-5 mb-5 ">

                <IonCard>
                    <IonCardHeader>
                        <IonCardTitle>
                            <IonToolbar>
                                <IonTitle><h1 className="text-center display-6">add Topic Article</h1></IonTitle>
                            </IonToolbar>
                        </IonCardTitle>
                    </IonCardHeader>
                    <IonCardContent>
                        <h1>{props.topic_name}</h1>
                        <form onSubmit={handleSubmit(addTopicArticle)}>
                            <IonItem>
                                <IonLabel position="stacked">Title</IonLabel>
                                <IonInput placeholder="name"
                                    type="text"
                                    {...register("name", { required: "Name Is Required" })}
                                >
                                </IonInput>
                            </IonItem>
                            <p style={{ color: "red" }}>
                                <ErrorMessage errors={errors} name="name" />
                            </p>

                            <IonItem>
                                <IonLabel position="stacked" >Content</IonLabel>
                                <div style={{ marginTop: "3%", marginBottom: "3%" }}>
                                    <Controller
                                        name="content"
                                        control={control}
                                        rules={{
                                            required: 'Content is required',
                                        }}
                                        render={({ field: { ...rest } }) => (
                                            <Editor
                                                textareaName="content"
                                                value={rest.value}

                                                init={{
                                                    height: 500,
                                                    width: 1030,
                                                    menubar: true,
                                                    plugins: [

                                                        'advlist', 'autolink', 'lists', 'link', 'image', 'charmap', 'preview',
                                                        'anchor', 'searchreplace', 'visualblocks', 'code', 'fullscreen',
                                                        'insertdatetime', 'media', 'table', 'code', 'help', 'wordcount'

                                                    ],

                                                    toolbar: 'undo redo | blocks | ' +
                                                        'bold italic forecolor | alignleft aligncenter ' +
                                                        'alignright alignjustify | bullist numlist outdent indent | ' +
                                                        'removeformat | help',
                                                    content_style: 'body { font-family:Helvetica,Arial,sans-serif; font-size:14px }'

                                                }}
                                                onEditorChange={(e) => {
                                                    setValue('content', e)
                                                }}
                                            />

                                        )}
                                    />
                                </div>

                            </IonItem>
                            <p style={{ color: "red" }}>
                                <ErrorMessage errors={errors} name="content" />
                            </p>

                            <div style={{ marginTop: "3%" }} className="text-center mb-5">
                                <IonButton color="danger" onClick={props.onClose}>Cancel</IonButton>
                                <IonButton color="primary" type="submit">
                                    Create
                                </IonButton>

                            </div>
                        </form>
                    </IonCardContent>
                </IonCard>

            </div>

        </Collapse>
    );
}
export default AddTopicArticle;
